-- Корректировка данных:

-- users
UPDATE users SET phone = CONCAT(8, '(', FLOOR(899 + RAND() * 100), ')', FLOOR(100 + RAND() * 899), '-', FLOOR(10 + RAND() * 89), '-', FLOOR(10 + RAND() * 89));

-- profiles
UPDATE profiles SET created_at = NOW() WHERE created_at < birthday;
UPDATE profiles SET updated_at = NOW() WHERE updated_at < created_at;

-- figure_params
UPDATE figure_params SET weight = FLOOR(50 + RAND() * 100);
UPDATE figure_params SET sleeve_length = FLOOR(29 + RAND() * 42);
UPDATE figure_params SET shoes_size = FLOOR(34 + RAND() * 12);
UPDATE figure_params SET hip_girth = FLOOR(86 + RAND() * 68);
UPDATE figure_params SET waist_girth = FLOOR(58 + RAND() * 68);
UPDATE figure_params SET chest_girth = FLOOR(78 + RAND() * 68);
UPDATE figure_params SET height = FLOOR(140 + RAND() * 60);

-- user_addresses
UPDATE user_addresses SET mail_index = FLOOR(111111 + RAND() * 888888);
UPDATE user_addresses SET apart_num = FLOOR(1 + RAND() * 100);
UPDATE user_addresses SET house_num = FLOOR(1 + RAND() * 100);
UPDATE user_addresses SET user_id = FLOOR(1 + RAND() * 100);

-- requisites
UPDATE requisites SET user_id = FLOOR(1 + RAND() * 100);
UPDATE requisites SET BIC_bank = FLOOR(100000000 + RAND() * 899999999);
UPDATE requisites SET checking_account = CONCAT(FLOOR(1000000000 + RAND() * 8999999999), FLOOR(1000000000 + RAND() * 8999999999));

-- discounts
UPDATE discounts SET discount = 0.85 WHERE id = 1;
UPDATE discounts SET discount = 0.83 WHERE id = 2;
UPDATE discounts SET discount = 0.80 WHERE id = 3;
UPDATE discounts SET discount = 0.77 WHERE id = 4;
UPDATE discounts SET discount = 0.75 WHERE id = 5;
UPDATE discounts SET discount = RAND() WHERE id > 5;

-- notifications
UPDATE notifications SET user_id = FLOOR(1 + RAND() * 100);

-- catalogs
UPDATE catalogs SET updated_at = NOW() WHERE updated_at < created_at;

-- products
UPDATE products SET catalog_id = FLOOR(1 + RAND() * 16); 
UPDATE products SET price = ROUND(200 + RAND() * 10799, 2);

-- product_properties
UPDATE 
	product_properties 
SET 
	property_price = (
		SELECT * FROM (
			SELECT NULL UNION SELECT 1
			) AS p 
		ORDER BY RAND() LIMIT 1
	);

UPDATE product_properties SET property_price = FLOOR(100 + RAND() * 400) WHERE property_price = 1;


UPDATE 
	product_properties 
SET gender = (
		SELECT * FROM (
			SELECT NULL UNION SELECT 'm' UNION SELECT 'f'
			) AS g 
		ORDER BY RAND() LIMIT 1
	);

-- payment_types
UPDATE payment_types SET updated_at = NOW() WHERE updated_at < created_at;

-- delivery_methods
UPDATE delivery_methods SET updated_at = NOW() WHERE updated_at < created_at;

-- delivery_services
UPDATE delivery_services SET phone = CONCAT(8, '(', FLOOR(899 + RAND() * 100), ')', FLOOR(100 + RAND() * 899), '-', FLOOR(10 + RAND() * 89), '-', FLOOR(10 + RAND() * 89));

-- available_cities
UPDATE available_cities SET delivery_service_id = FLOOR(1 + RAND() * 100);
UPDATE available_cities SET price = FLOOR(499 + RAND() * 2001);

-- orders
UPDATE orders SET payment_type_id = FLOOR(1 + RAND() * 3);
UPDATE orders SET user_id = FLOOR(1 + RAND() * 100);

-- orders_delivery
UPDATE orders_delivery SET updated_at = NOW() WHERE updated_at < created_at;

-- orders_products
UPDATE orders_products SET updated_at = NOW() WHERE updated_at < created_at; 

-- users_carts
UPDATE users_carts SET user_id = FLOOR(1 + RAND() * 100);
UPDATE users_carts SET product_id = FLOOR(1 + RAND() * 100);

-- storehouses
UPDATE storehouses SET updated_at = NOW() WHERE updated_at < created_at;

-- storehouses_products
UPDATE storehouses_products SET storehouse_id = FLOOR(1 + RAND() * 30);
UPDATE storehouses_products SET value = FLOOR(30 + RAND() * 971);

-- rewievs
UPDATE reviews SET user_id = FLOOR(1 + RAND() * 100);

-- rewiev_media
UPDATE review_media SET image_id = FLOOR(1 + RAND() * 100);
UPDATE review_media SET review_id = FLOOR(1 + RAND() * 100);

-- images
UPDATE 
	images
SET 
	user_id = (
		SELECT * FROM (
			SELECT 1 UNION SELECT NULL
			) AS i 
		ORDER BY RAND() LIMIT 1
	);

UPDATE 
	images 
SET 
	product_id = (
		SELECT * FROM (
			SELECT 2 UNION SELECT NULL
			) AS i 
		ORDER BY RAND() LIMIT 1
	);

UPDATE 
	images
SET 
	delivery_service_id = (
		SELECT * FROM (
			SELECT 3 UNION SELECT NULL
			) AS p 
		ORDER BY RAND() LIMIT 1
	);

UPDATE images SET product_id = NULL WHERE user_id = 1;
UPDATE images SET delivery_service_id = NULL WHERE user_id = 1 OR product_id = 2;
UPDATE images SET user_id = FLOOR(1 + RAND() * 100) WHERE (user_id = 1 OR user_id IS NULL) AND product_id IS NULL AND delivery_service_id IS NULL;
UPDATE images SET product_id = FLOOR(1 + RAND() * 100) WHERE product_id = 2;
UPDATE images SET delivery_service_id = FLOOR(1 + RAND() * 100) WHERE delivery_service_id = 3;
UPDATE images SET file_path = CONCAT('http://dropbox.com/wb/file_', FLOOR(1000 + RAND() * 9000),'.img');
